window.bookSummaryJSON = "<p><b>Thirty hours of magic, intrigue, and adventure.</b></p> <p>In a realm where wizards rule, magic reigns supreme. Power. The ambitious thirst for it. But when a power-hungry wizard lord seeks to expand his might, he triggers a series of events unforeseen. The balance of magic is altered, races of old return, and beasts of legend stalk the land.</p> <p>This tale follows a squad of unlikely heroes:</p> <p></p> <ul> <li>Jerrell \"Jace\" - a clever thief whose outrageous exploits force him to hide his identity.</li> <li>Rhoa - an acrobat whose obsession for revenge will reshape her destiny.</li> <li>Rawk - an outcast from his people, this dwarf struggles against urges he cannot control.</li> <li>Brogan - once a renowned warrior, he labors beneath the weight of his regrets.</li> <li>Narine - a princess caught between her mad wizard lord father and jealous brother.</li> <li>Adyn - trained as a lethal bodyguard, her purpose in life is to protect Narine.</li> <li>Blythe - skilled in archery and woodcraft, she follows her heart, but where will it lead?</li> <li>Salvon - a mysterious storyteller who seems to know something about everything.</li> </ul> <p>These characters lead a compelling and memorable cast including ruthless wizards who vie for thrones able to grant the power of a god. <b>How can one defeat a god? </b></p> <p><b>Fate of Wizardoms is narrated by Travis Baldree, the same talent from Will Wight's Cradle series. This omnibus includes the first three books in the series. </b><b><i>Fate of Wizardoms </i></b><b>is a re-imagining of classic epic fantasy, told in a modern, fast-paced style packed with beloved genre tropes twisted in an uncommon fashion, perfect for fans of </b><b><i>The Witcher</i></b><b>, Kingkiller Chronicles, or Wheel of Time.</b></p>"; 
